import React from 'react';

export default class App extends React.Component{
  render(){
    return (
        <div>
          <h1>Lista de animais:</h1>
          <ul>
            <li>Cachorro</li>
            <li>Gato</li>
            <li>Galinha</li>
            <li>pit</li>
            <li>Peixe</li>
          </ul>
        </div>
      );
  }
}
